"""The MedMNIST dataset consists of 12 pre-processed 2D datasets and 6 pre-processed 3D datasets from selected sources covering primary data modalities (e.g., X-Ray, OCT, Ultrasound, CT, Electron Microscope), diverse classification tasks (binary/multi-class, ordinal regression and multi-label) and data scales (from 100 to 100,000). For simplicity, we call the collection of all 2D datasets as MedMNIST2D, and that of 3D as MedMNIST3D.

![image.png](data:image/png;base64,)

##Load and Visualize Images from MedMNIST
Weâ€™ll use the PneumoniaMNIST dataset from MedMNIST, which contains chest X-ray images labeled as normal or pneumonia.
"""

import numpy as np
import matplotlib.pyplot as plt
from medmnist import PneumoniaMNIST

#Load the PneumoniaMNIST dataset
data = PneumoniaMNIST (split='train', download=True)

#The PneumoniaMNIST dataset is loaded using the split='train' argument. You can also use split='test' or split='val' for testing and validation sets.

#The download=True argument ensures the dataset is downloaded if itâ€™s not already available.

import numpy as np
import matplotlib.pyplot as plt
from medmnist import PneumoniaMNIST

# Load the PneumoniaMNIST dataset
data = PneumoniaMNIST(split='train', download=True)

# Display dataset information
print(f"Dataset shape: {data.imgs.shape}")  # (Number of images, Height, Width)
print(f"Number of classes: {len(data.info['label'])}")
print(f"Class labels: {data.info['label']}")

# Visualize the first 9 images in the dataset

fig, axes = plt.subplots(3, 3, figsize=(10, 10))

#The first 9 images are displayed using matplotlib.
#Each image is shown in grayscale, and the corresponding label is displayed as the title.

for i, ax in enumerate(axes.ravel()):
    image = data.imgs[i]  # Get the i-th image
    label = data.labels[i]  # Get the corresponding label

    ax.imshow(image, cmap='gray')
    ax.set_title(f"Label: {label[0]}")  # Label 0: Normal, Label 1: Pneumonia
    ax.axis('off')

plt.suptitle("PneumoniaMNIST Dataset - Chest X-Rays", fontsize=16)
plt.show()

"""Dataset Properties explored"""

# Print dataset details
print(f"Number of images: {data.imgs.shape[0]}")
print(f"Image shape: {data.imgs.shape[1:]}")  # Height and Width
print(f"Unique labels: {np.unique(data.labels)}")  # Should be [0, 1] for binary classification

## Saving images to local machine for future use

from PIL import Image

# Save the first image as a PNG file
sample_image = data.imgs[0]
sample_label = data.labels[0]

# Convert the NumPy array to a PIL image
image_pil = Image.fromarray(sample_image)

# Save the image
image_pil.save("sample_chest_xray.png")
print(f"Sample image saved as 'sample_chest_xray.png' with label {sample_label[0]}")

